INSERT INTO `stations` VALUES ('2014-04-23 15:06:28','2014-04-23 15:08:26',1,'S28','M_Sr1','Buzzer',NULL,'Active','Unknown'),('2014-04-23 15:06:28','2014-04-23 15:08:27',2,'E06','I_E1','English man','A station that broadcasts (possibly to spies) numbers to be used with a one time pad.','Active','Russia'),('2014-04-23 15:06:28','2014-04-23 15:06:28',3,'E02','','Arabic man/The Babbler','Very little is known about this station.','Inactive','Unknown'),('2014-04-23 15:06:28','2014-04-23 15:06:28',4,'E03','','Lincolnshire Poacher','Plays the tune \"The Lincolnshire Poacher\" before each TX as a sort of callsign. Messages were always 200 groups long, and were always taking 45 minutes to transmit.','Inactive (last heard July 2008)','Cyprus (Akrotiri RAF base)'),('2014-04-23 15:06:28','2014-04-23 15:06:28',5,'E03a','','Cherry Ripe','Uses same format, only interval signal is different - this time the tune is \"Cherry Ripe\".','Inactive (last heard December 2009)','Guam, then possibly moved to northern Australia'),('2014-04-23 15:06:28','2014-04-23 15:06:29',6,'E04','','Cherry Ripe','Was deleted due to being matched up with E03, gaining the sub designater E03a','Deleted',NULL),('2014-04-23 15:06:29','2014-04-23 15:06:29',7,'E05','','Counting station \"Cynthia\"','CIA station. Sent messages as 3 figure/2 figure groups. Operated many years, heavily sticking to its schedules.','Inactive (last heard October 2003)','Warrenton, USA (with many other sites worldwide)'),('2014-04-23 15:06:29','2014-04-23 15:07:32',8,'E06a','','English Man','Variant of E06 sending 2-group message with 11111 and \"random\" number. Sometimes normal messages followed. Very rare.','Active','Russia'),('2014-04-23 15:06:29','2014-04-23 15:06:29',9,'E06b','','English Man','Varient of E06 with a 3 figure ID and a 5 figure group in the call. always sends 2 messages. This is a very rare station!','Active','Russia'),('2014-04-23 15:06:29','2014-04-23 15:06:29',10,'E01','','Ready Ready','Counterpart to S02. Main frequncies were 4740 and 6675 kHz. Broadcast started with woman repeating 5 figure identifier for 5 minutes. After callup group count was said (\"22, 22\") followed by \"Ready, Ready\" and goes into 5 figure groups.','Inactive','Bulgaria'),('2014-04-23 15:06:29','2014-04-23 15:08:26',11,'E07','','English Man',NULL,'Active','Russia'),('2014-04-23 15:06:29','2014-04-23 15:08:27',12,'E07a','','English Man','E07a uses USB where as E07 uses AM, also E07a has an extra 5 figure group in the call where E07 does not.','Active','Russia'),('2014-04-23 15:06:29','2014-04-23 15:06:29',13,'E09','','Magnetic Fields','Freqencies: 11290 ','Inactive','Unknown'),('2014-04-23 15:06:29','2014-04-23 15:06:30',14,'E10','','Mossad','E10 was believed to be operated by the israeli intelligence, Mossad. I was last heard at night on the 28th of febuary 2011.','Inactive','Israel'),('2014-04-23 15:06:30','2014-04-23 15:06:30',15,'E10a','',NULL,'Variant of E10 sending various strings. Mostly one letter (HNC B, HNC Z etc). Some of them were containing time information. The most famous one was sent on March 15, 2006 at 2200z on 3273//5339 kHz: KPA G1O2O3D4N5I6G7H8T9 (if you will remove numbers, you will get GOODNIGHT).','Inactive','Israel'),('2014-04-23 15:06:30','2014-04-23 15:08:27',16,'E11','','Oblique','E11 always sends a null message. Format is: nnn Oblique 00 (nnn/00). nnn is the ID. Transmissions always last 3 minutes. When it sends a message is becomes E11a','Active','Poland'),('2014-04-23 15:06:30','2014-04-23 15:08:26',17,'E11a','','Oblique','E11 message varient','Active','Poland'),('2014-04-23 15:06:30','2014-04-23 15:06:30',18,'E11b','','Oblique','E11b is another E11 varient that sends a message, but with stutter groups (77777 77777) at the begining and end of each message','Active','Poland'),('2014-04-23 15:06:30','2014-04-23 15:06:30',19,'E11c','','Oblique','E11c is E11 but with triplet element in ID (xxx/555/00), 755/555/00 only hear. Voice version of M03a not heard since May 2000.','Active','Poland'),('2014-04-23 15:06:30','2014-04-23 15:06:30',20,'E12','','NNN',NULL,'Inactive','Austria'),('2014-04-23 15:06:30','2014-04-23 15:06:30',21,'E13','','Five Dashes',NULL,'Inactive','Germany'),('2014-04-23 15:06:30','2014-04-23 15:06:30',22,'E14','','4F Control',NULL,'Inactive','USA'),('2014-04-23 15:06:30','2014-04-23 15:06:30',23,'E15','','Phonetic Alphabet - Pre-NATO','Noted for using an unidentified Pre-NATO phonetic alphabet. Last known broadcast was in 2006','Inactive','Egypt'),('2014-04-23 15:06:30','2014-04-23 15:06:30',24,'E16','','Two letter',NULL,'Inactive','Germany'),('2014-04-23 15:06:30','2014-04-23 15:06:30',25,'E17','','English Lady',NULL,'Inactive','Russia'),('2014-04-23 15:06:30','2014-04-23 15:06:30',26,'E17a','',NULL,'2 different voices in one transmission','Inactive','Russia'),('2014-04-23 15:06:30','2014-04-23 15:06:30',27,'E17y','',NULL,NULL,'Inactice','Cuba?'),('2014-04-23 15:06:30','2014-04-23 15:08:26',28,'E17z','','English Lady 0 0 0 0 0','This station is English variant of S06s. Messages are usually very short, new one comes every 2 weeks.','Active','Ukraine'),('2014-04-23 15:06:30','2014-04-23 15:06:30',29,'E18','','Fife Free/Edna Sednitzer',NULL,'Inactive',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',30,'E19','','Irish Man',NULL,'Inactive',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',31,'E20','',NULL,NULL,'Inactive',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',32,'E21','','4F Counting',NULL,'Inactive',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',33,'E21a','',NULL,NULL,'Inactive',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',34,'E22','','Indian man','Was withdrawn due to it being found to be a test transmission for All india radio','Withdrawn','India'),('2014-04-23 15:06:30','2014-04-23 15:06:30',35,'E23','','Swedish Rhapsody','Started in 1998 replacing G02, using voice of E05 Counting Station and \"without music intro\". Full transmission will always last 43 minutes and 30 seconds.','Inactive',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',36,'E24','','Allo Allo','There is much speculation about E24 ranging from it being an emergency broadcast station that only broadcasts extremely rarely to it being mistaken to be a number station at all.','Inactive',NULL),('2014-04-23 15:06:30','2014-04-23 15:08:25',37,'E25','','No coined names yet','Believed to be of Egyption origin','Active','Egypt?'),('2014-04-23 15:06:30','2014-04-23 15:06:30',38,'E25a','',NULL,'This station calls in 785 77 788 71 72 73 74 75 76 78 style for some time, then shutdowns without message. Believed to be control ones.','Active','Egypt?'),('2014-04-23 15:06:30','2014-04-23 15:06:30',39,'E25b','',NULL,'E25b is actually just E25 in the arabic language. The reason it is still classified as an English language station is because the call up it still in English. Used ID\'s were 830 and 835. Not currently active since E25 uses automated female voice.','Inactive','Egypt?'),('2014-04-23 15:06:30','2014-04-23 15:06:30',40,'E26','',NULL,'E26 was actually wrongly classified by Enigma 2000. It was almost immediately Removed. This page is here purely for historical purposes. Its current designator is E25b.','Withdrawn',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',41,'E27','',NULL,'The carrier is generally up for about 5 minutes prior to broadcast. A long 1k tone for tuning which is then followed by 5 long morse like dashes which signal that the message is about to begin. Only 20 group messages were heard.','Active',NULL),('2014-04-23 15:06:30','2014-04-23 15:06:30',42,'S01','','Ada ','Female, computerised voice','Inactive',NULL),('2014-04-23 15:06:31','2014-04-23 15:06:31',43,'S02','','Drums and Trumpets','Female, computerised voice','Inactive',NULL),('2014-04-23 15:06:31','2014-04-23 15:06:31',44,'S02a','','Drums And Trumpets (A- With bugle)','Just as S02 but with a bugel','Inactive',NULL),('2014-04-23 15:06:31','2014-04-23 15:06:31',45,'S02b','','Drums and Trumpets (B- bugle intro)','An intro